            sentence += f"and has an elevation of {triple.object} meters, "
        elif triple.predicate == "location":
            sentence += f"which is located in {triple.object}, "
        elif triple.predicate == "runwayLength":
            sentence += f"and has a runway length of {triple.object} meters, "
        else:
            sentence += f"and has a {triple.predicate} of {triple.object}, "

